  true,\n\t\"url\": null,\n\t\"notes\": \"<p>The Medicaid managed care penetration
  rates and expansion enrollment by state charts are composed annually by the Data
  and System Group (DSG) of the Centers for Medicare and Medicaid Services (CMS).
  The enrollment statistics profile Medicaid managed care programs on a state specific
  basis as of December 31, 2010. The information was collected from State Medicaid
  agencies and CMS regional offices. Data is presented for all states, the District
  of Columbia, Puerto Rico, and the Virgin Islands. Data is not presented for the
  following territories, Guam, Northern Mariana Islands, and American Samoa.  The
  charts provide national-level summary tables relating to Medicaid and managed care
  enrollment by State and States with comprehensive health care reform demonstrations.</p>n\",\n\t\"license_title\":
